lloque international sur le th\u00e8me : \u00ab GESTION DES \u00c9QUIPEMENTS M\u00c9DICO-TECHNIQUES DANS LES \u00c9TABLISSEMENTS DE SANT\u00c9 AFRICAINS : ENJEUX ET D\u00c9FIS* \u00bb<\/p><p><br><\/p><p><span style=\"color: rgb(0, 0, 0);\">@ Thierry Laurent GLITHO RESHAOC\/SE<\/span><\/p>","created_at":"2023-07-28T10:04:30.000000Z","updated_at":"2023-07-28T10:04:30.000000Z"}],"first_page_url":"http:\/\/localhost\/api\/actualites?page=1","from":1,"last_page":1,"last_page_url":"http:\/\/localhost\/api\/actualites?page=1","links":[{"url":null,"label":"&laquo; Previous","active":false},{"url":"http:\/\/localhost\/api\/actualites?page=1","label":"1","active":true},{"url":null,"label":"Next &raquo;","active":false}],"next_page_url":null,"path":"http:\/\/localhost\/api\/actualites","per_page":5,"prev_page_url":null,"to":4,"total":4}}'
